        public override BaseAddonDeed Deed { get { return new EndOfTimeAddonDeed(); } }

        [Constructable]
        public EndOfTimeAddon()
        {

            for (int i = 0; i < m_AddOnSimpleComponents.Length / 4; i++)
                AddComponent(new AddonComponent(m_AddOnSimpleComponents[i, 0]), m_AddOnSimpleComponents[i, 1], m_AddOnSimpleComponents[i, 2], m_AddOnSimpleComponents[i, 3]);

            AddComplexComponent((BaseAddon)this, 2852, 7, -1, 24, 0, 30, "", 1);// 951
            AddComplexComponent((BaseAddon)this, 5703, 8, 0, 24, 0, 1, "", 1);// 962
            AddComplexComponent((BaseAddon)this, 2594, 3, 2, 27, 0, 1, "", 1);// 963

        }

        public EndOfTimeAddon(Serial serial)
            : base(serial)
        {
        }

        private static void AddComplexComponent(BaseAddon addon, int item, int xoffset, int yoffset, int zoffset, int hue, int lightsource)
        {
            AddComplexComponent(addon, item, xoffset, yoffset, zoffset, hue, lightsource, null, 1);
        }

        private static void AddComplexComponent(BaseAddon addon, int item, int xoffset, int yoffset, int zoffset, int hue, int lightsource, string name, int amount)
        {
            AddonComponent ac;
            ac = new AddonComponent(item);
            if (name != null && name.Length > 0)
                ac.Name = name;
            if (hue != 0)
                ac.Hue = hue;
            if (amount > 1)
            {
                ac.Stackable = true;
                ac.Amount = amount;
            }
            if (lightsource != -1)
                ac.Light = (LightType)lightsource;
            addon.AddComponent(ac, xoffset, yoffset, zoffset);
        }

        public override void Serialize(GenericWriter writer)
        {
            base.Serialize(writer);
            writer.Write(0); // Version
        }

        public override void Deserialize(GenericReader reader)
        {
            base.Deserialize(reader);
            int version = reader.ReadInt();
        }
    }

    public class EndOfTimeAddonDeed : BaseAddonDeed
    {
        public override BaseAddon Addon { get { return new EndOfTimeAddon(); } }

        [Constructable]
        public EndOfTimeAddonDeed()
        {
            Name = "Deed to the End of Time";
        }

        public EndOfTimeAddonDeed(Serial serial)
            : base(serial)
        {
        }
        #region OnDoubleClick
        public override void OnDoubleClick(Mobile from)
        {
            Place_Addon(from);
        }
        public override void OnDoubleClickCantSee(Mobile from)
        {
            Place_Addon(from);
        }
        public override void OnDoubleClickDead(Mobile from)
        {
            Place_Addon(from);
        }
        #endregion

        private void Place_Addon(Mobile from)
        {
            if (from.AccessLevel < AccessLevel.Counselor)
                return;
            BaseAddon i = new EndOfTimeAddon();
            Point3D l = from.Location;
            i.Map = from.Map;
            i.X = l.X;
            i.Y = l.Y;
            i.Z = l.Z;
            i.Location = l;

            this.Delete();
        }

        public override void Serialize(GenericWriter writer)
        {
            base.Serialize(writer);
            writer.Write(0); // Version
        }

        public override void Deserialize(GenericReader reader)
        {
            base.Deserialize(reader);
            int version = reader.ReadInt();
        }
    }
